from sklearn.datasets import load_iris
from sklearn.model_selection import GridSearchCV
from sklearn.svm import SVC
import matplotlib.pyplot as plt

# Load dataset
iris = load_iris()
X = iris.data
y = iris.target

# Splitting manual menggunakan rasio
split_ratio = 0.8
split_index = int(len(X) * split_ratio)

# Splitting data
X_train, X_test = X[:split_index], X[split_index:]
y_train, y_test = y[:split_index], y[split_index:]

# Parameter grid
param_grid = {'C': [0.1, 1, 10, 100],
              'gamma': [0.1, 0.01, 0.001, 0.0001],
              'kernel': ['linear', 'rbf', 'poly']}

# SVM model
svm_model = SVC()

# GridSearchCV
grid_search = GridSearchCV(svm_model, param_grid, cv=5)

# Fit the model to the data
print("Fitting model with GridSearchCV...")
grid_search.fit(X_train, y_train)

# Print the best parameters found
print("Best parameters found:")
print(grid_search.best_params_)

# Visualisasi hyperplane
# SVM model dengan parameter terbaik yang ditemukan
best_svm_model = SVC(**grid_search.best_params_)
best_svm_model.fit(X_train, y_train)

# Evaluate on test set
accuracy = best_svm_model.score(X_test, y_test)
print("Accuracy on test set:", accuracy)

